import React, { useState, useEffect, useContext } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { UserContext } from '../contexts/UserContext';
import axios from 'axios';
import '../styles/Profile.css';

const Profile = () => {
  const { user } = useContext(UserContext);
  const [savedRoadmaps, setSavedRoadmaps] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchSavedRoadmaps = async () => {
      try {
        if (!user?.id) {
          setIsLoading(false);
          return;
        }
        const response = await axios.get(`/api/roadmaps/${user.id}`);
        setSavedRoadmaps(response.data);
      } catch (error) {
        console.error('Error fetching roadmaps:', error);
      } finally {
        setIsLoading(false);
      }
    };

    fetchSavedRoadmaps();
  }, [user]);

  if (!user) {
    return (
      <div className="profile-container">
        <div className="no-user">
          <span className="material-icons">account_circle</span>
          <h2>Please Log In</h2>
          <p>You need to be logged in to view your profile</p>
          <Link to="/login" className="login-button">
            Go to Login
          </Link>
        </div>
      </div>
    );
  }

  return (
    <div className="profile-container">
      <div className="page-header">
        <button className="back-button" onClick={() => navigate(-1)}>
          <span className="material-icons">arrow_back</span>
          Back
        </button>
        <h2 className="page-title">Profile</h2>
      </div>
      <div className="profile-header">
        <div className="profile-avatar large">
          {user?.name ? user.name[0].toUpperCase() : '?'}
        </div>
        <div className="profile-info">
          <h1>{user?.name}</h1>
          <p>{user?.email}</p>
        </div>
      </div>

      <div className="saved-roadmaps">
        <h2>My Career Roadmaps</h2>
        
        {isLoading ? (
          <div className="loading-spinner">Loading...</div>
        ) : savedRoadmaps.length > 0 ? (
          <div className="roadmaps-grid">
            {savedRoadmaps.map((roadmap, index) => (
              <div key={index} className="roadmap-card">
                <div className="roadmap-card-header">
                  <span className="material-icons">map</span>
                  <h3>{roadmap.title}</h3>
                </div>
                <div className="roadmap-card-content">
                  <p><strong>Career Path:</strong> {roadmap.careerPath}</p>
                  <p><strong>Technology:</strong> {roadmap.technology}</p>
                </div>
                <div className="roadmap-card-actions">
                  <button className="view-button">
                    <span className="material-icons">visibility</span>
                    View Details
                  </button>
                  <button className="delete-button">
                    <span className="material-icons">delete</span>
                  </button>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="no-roadmaps">
            <span className="material-icons">folder_open</span>
            <p>No saved roadmaps yet</p>
            <Link to="/" className="create-roadmap-button">
              Create Your First Roadmap
            </Link>
          </div>
        )}
      </div>
    </div>
  );
};

export default Profile;
